import styled from "styled-components";

function Find() {
  return (
    <Main>
      <div className="container">
        <div className="text">ID / 비밀번호 찾기</div>
        <div className="boxes">
          <div className="box box1">
            <div></div>
            <div></div>
            <div></div>
          </div>
          <div className="box box2">
            <div></div>
            <div></div>
            <div></div>
          </div>
        </div>
      </div>
    </Main>
  );
}

export const Main = styled.div`
  height: 90vh;
  display: flex;
  justify-content: center;
  align-items: center;
  .text {
    font-size: 30px;
    font-weight: bold;
    margin-bottom: 20px;
  }
  .boxes {
    width: 80vw;
    height: 50vh;
    display: flex;
    justify-content: center;
  }
  .box {
    width: 40vw;
    height: 50vh;
  }
  .box1 {
    background-color: #e4e4e4;
  }
  .box2 {
    background-color: #222222;
  }
`;

export default Find;
